import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <main>
      <section className="hero">
        <h1>Welcome to PRECI-COM</h1>
        <p>Your trusted partner in automobile parts manufacturing.</p>
      </section>
      <section className="overview">
        <h2>About Us</h2>
        <p>PRECI-COM CNC established in the year of 2000. We manufacture precision machined automobile and engineering components with state-of-the-art CNC machines.</p>
        <p>The company is located in Chennai, India, and has around 90 employees working in two shifts.</p>
      </section>
    </main>
  );
}

export default Home;
